.circle{
    border:1px solid black;
    width: 100px;
    height: 100px;
    border-radius:50%;
    margin-left:10vw;
    margin-top:10vh;
}
#app4 > .circle.active{
    animation:change 1s infinite alternate linear;
}
@keyframes change{
    0%{
        background-color: red;
    }
    100%{
        background-color: blue;
    }
}
